From Walt Disney Animation Studios comes a hilarious, arcade-game-hopping journey
in Disney's Wreck-It Ralph. For decades, Ralph has played the bad guy in his popular
video game. In a bold move, he embarks on an action-packed adventure and sets out to
prove to everyone that he is a true hero with a big heart. As he explores exciting
new worlds, he teams up with some unlikely new friends including feisty misfit
Vanellope von Schweetz. Then, when an evil enemy threatens their world, Ralph
realizes he holds the fate of the entire arcade in his massive hands.

Actors: John C. Reilly, Jack McBrayer, Sarah Silverman and Jane Lynch.
Writer: Rich Moore, Phil Johnston and Jim Reardon.
Directors: Rich Moore.

Produced by Walt Disney Animation Studios.

